import { Box } from '@chakra-ui/react';
import React, { useEffect } from 'react';

import GitHubCalendar from 'react-github-calendar';




const Calendar = () => {
 
  return (
    <Box>
       <GitHubCalendar username= "Kamalakanta01" responsive={true} />
    </Box>
  );
};

export default Calendar;
